<script type="application/javascript">
    $(document).ready(function () {
        $("#submitBtn").on("click", function () {
            $.showLoading();
            $("#centerTableEmpty").html("Silahkan tunggu . . . .")
        });

        $('#keyword').keypress(function (event) {
            var keycode = event.keyCode || event.which;
            if (keycode == '13') {
                $('#submitBtn').click();
                return false;
            }
            return;
        });

        function getPenyedia() {
            var komoditas = $("#komoditas").val();

            if (komoditas !== "") {
                $(document).ajaxStart(function () {
                    $.showLoading();
                });
                $.ajax({
                    dataType: "json",
                    url: "/katalog.produkctr/getpenyedia",
                    data: {
                        komoditas_id: komoditas
                    },
                    success: function (result) {
                        var html = "<option value=''>" + 'Pilih Semua' + "</option>";
                        for (var key in result) {
                            var obj = result[key];
                            html = html + "<option value='" + obj["id"] + "'>" + obj["nama_penyedia"] + "</option>"
                        }
                        $("#penyedia").html(html);

                        $('#penyedia').select2({
                            minimumInputLength: 2,
                            placeholder: function(){
                                $(this).data('placeholder');
                            }
                        });
                    }
                });
                $(document).ajaxComplete(function () {
                    $.hideLoading();
                });
            }
        }

        $("#komoditas").on("change", function () {
            getPenyedia();
        });

        $("td select").on("change", function() {
            var str = "Apakah Anda Yakin"
            var value = this.value;
            var $cell = $(this).parent();
            var $row = $cell.parent();
            if (value) {
                if (value.includes('edit')) {
                    var strId = value.replace("edit ", "").replace("(", "").replace(")", "");
                    directEdit(strId);
                } else {
                    let isExcuted = confirm(str);
                    if (isExcuted) {
                        sendHapus(value);
                    }
                }
            }
        });

        function directEdit(id) {
            let idInt = parseInt(id)
            window.location.href = "/katalog.produkctr/editproduknew" + "?produkId=" + idInt;
        }

        var currentId;
        jQuery(document).on('click', '.open-edit', function () {
            var view = jQuery(this);
            currentId = view.data('value');
            if (!this.hasAttribute('disabled')) {
                openModal();
            }
        });

        jQuery('.open-button-yes').click(function () {
            if (jQuery('#alasan_buka_tombol_edit').val() === '') {
                showToast("Belum mengisi alasan", false);
            } else {
                var checkboxesProduk = document.getElementsByName('idProduk');
                var produkIdLoop = "";

                for (var i=0, n=checkboxesProduk.length;i<n;i++)
                {
                    if (checkboxesProduk[i].checked)
                    {
                        produkIdLoop += ","+checkboxesProduk[i].value;
                    }
                }

                if (produkIdLoop) produkIdLoop = produkIdLoop.substring(1);

                $('#id_buka_edit_produk').val(produkIdLoop);
                send($(this).val());
            }
        });

        function openModal() {
            jQuery('#open-edit-modal').modal({
                backdrop: 'static',
                keyboard: false
            });
        }

        function send(a) {
            jQuery.ajax({
                dataType: "json",
                url: "/katalog.produkctr/openbyadmin",
                method: "POST",
                data: {
